using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// NSTextCheckingResult is a class used to describe items located by text checking. Each of these objects represents an occurrence of requested textual content that has been found during the analysis of a block of text.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/AppKit/Reference/NSTextCheckingResult_Class/index.html#//apple_ref/occ/cl/NSTextCheckingResult"/>	[iOSVersion(4)]	public class NSTextCheckingResult : NSObject//, AnyObject, NSCoding, NSCopying, NSObjectProtocol	{		/// <summary>		/// Returns the result type that the range represents.		/// </summary>		/// <param name="idx">The index of the result.</param>		[iOSVersion(4)]		[Export("rangeAtIndex")]		public NSRange RangeAtIndex(int idx) { return default(NSRange); }				/// <summary>		/// Creates and returns a text checking result with the specified replacement string.		/// </summary>		/// <param name="range">The range of the detected result.</param>		/// <param name="replacementString">The replacement string.</param>		[iOSVersion(4)]		[Export("replacementCheckingResultWithRange")]		public static NSTextCheckingResult ReplacementCheckingResultWithRange(NSRange range, string replacementString) { return default(NSTextCheckingResult); }				/// <summary>		/// Creates and returns a type checking result with the specified regular expression data.		/// </summary>		/// <param name="ranges">A C array of ranges, which must have at least one element, and the first element represents the overall range.</param>		/// <param name="count">The number of items in the ranges array.</param>		/// <param name="regularExpression">The regular expression.</param>		[iOSVersion(4)]		[Export("regularExpressionCheckingResultWithRanges")]		public static NSTextCheckingResult RegularExpressionCheckingResultWithRanges(NSRangePointer