ngResultWithRange")]		public static NSTextCheckingResult PhoneNumberCheckingResultWithRange(NSRange range, string phoneNumber) { return default(NSTextCheckingResult); }				/// <summary>		/// Creates and returns a text checking result with the specified date.		/// </summary>		/// <param name="range">The range of the detected result.</param>		/// <param name="date">The detected date.</param>		[iOSVersion(4)]		[Export("dateCheckingResultWithRange")]		public static NSTextCheckingResult DateCheckingResultWithRange(NSRange range, NSDate date) { return default(NSTextCheckingResult); }				/// <summary>		/// Creates and returns a text checking result with the specified date, time zone, and duration.		/// </summary>		/// <param name="range">The range of the detected result.</param>		/// <param name="date">The detected date.</param>		/// <param name="timeZone">The detected time zone.</param>		/// <param name="duration">The detected duration.</param>		[iOSVersion(4)]		[Export("dateCheckingResultWithRange")]		public static NSTextCheckingResult DateCheckingResultWithRange(NSRange range, NSDate date, NSTimeZone timeZone, NSTimeInterval duration) { return default(NSTextCheckingResult); }				/// <summary>		/// Creates and returns a text checking result with the specified dash corrected replacement string.		/// </summary>		/// <param name="range">The range of the detected result.</param>		/// <param name="replacementString">The replacement string.</param>		[iOSVersion(4)]		[Export("dashCheckingResultWithRange")]		public static NSTextCheckingResult DashCheckingResultWithRange(NSRange range, string replacementString) { return default(NSTextCheckingResult); }				/// <summary>		/// Creates and returns a text checking result with the specified quote-balanced replacement string.		/// </summary>		/// <param name="range">The range of the detected result.</param>		/// <param name="replacementString">The replacement string.</param>		[iOSVersion(4)]		[Expor