pe checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("addressComponents")]		public Dictionary<NSObject, AnyObject> AddressComponents { get; private set; }				/// <summary>		/// The phone number of a type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("phoneNumber")]		public string PhoneNumber { get; private set; }				/// <summary>		/// The date component of a type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("date")]		public NSDate Date { get; private set; }				/// <summary>		/// The duration component of a type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("duration")]		public NSTimeInterval Duration { get; private set; }				/// <summary>		/// The time zone component of a type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("timeZone")]		public NSTimeZone TimeZone { get; private set; }				/// <summary>		/// The detected orthography of a type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("orthography")]		public NSOrthography Orthography { get; private set; }				/// <summary>		/// The details of a located grammatical type checking result. (read-only)		/// </summary>		[iOSVersion(4)]		[Export("grammarDetails")]		public AnyObject[] GrammarDetails { get; private set; }	}	/// <summary>	/// These constants specify the type of checking the methods should do. They are returned by resultType.	/// </summary>	[iOSVersion(4)]	public enum NSTextCheckingType	{		/// <summary>		/// Attempts to identify the language		/// </summary>		[iOSVersion(4)]		Orthography,		/// <summary>		/// Checks spelling.		/// </summary>		[iOSVersion(4)]		Spelling,		/// <summary>		/// Checks grammar.		/// </summary>		[iOSVersion(4)]		Grammar,		/// <summary>		/// Attempts to locate dates.		/// </summary>		[iOSVersion(4)]		Date,		/// <summary>		/// Attempts to locate addresses.		/// </summary>		[iOSVersion(4)]		Address,		/// <summary>		/// Attempts to locate URL links.		/// </summary>		[iOSVersion(4)]		Link,		/// <summary>		/// Replaces quotes with smart quotes.		/// </summary>		[iOSVersion(4)]		Quote,		/// <summary>		/// Replaces dashes with em-dashes.		/// </summary>		[iOSVersion(4)]		Dash,		/// <summary>		/// Replaces characters such as (c) with the appropriate symbol (in this case Â©).		/// </summary>		[iOSVersion(4)]		Replacement,		/// <summary>		/// Performs autocorrection on misspelled words.		/// </summary>		[iOSVersion(4)]		Correction,		/// <summary>		/// Matches a regular expression.		/// </summary>		[iOSVersion(4)]		RegularExpression,		/// <summary>		/// Matches a phone number.		/// </summary>		[iOSVersion(4)]		PhoneNumber,		/// <summary>		/// Matches a transit information, for example, flight information.		/// </summary>		[iOSVersion(4)]		TransitInformation,	}	/// <summary>	/// Defines the types of checking that are available. These values can be combined using the C-bitwise OR operator. The system supports its own internal types, and the user can extend those types by subclassing NSTextCheckingResult and adding their own custom types.	/// </summary>	[iOSVersion(4)]	public struct NSTextCheckingTypes	{		static public implicit operator NSTextCheckingTypes(UInt64 value)		{			return default(NSTextCheckingTypes);		}		static public implicit operator UInt64(NSTextCheckingTypes value)		{			return default(UInt64);		}	}}